import { useRouter } from 'next/router'

import Layout from '../../../../components/MyLayout';

const Comment = () => {
  const router = useRouter()
  const { id, date, section } = router.query

  return (
    <Layout>
      <h1>id: {id}</h1>
      <h1>section: {section}</h1>
      <h1>date: {date}</h1>
    </Layout>
  )
}

export default Comment
